// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/FeedRegistryInterface.sol";
import "./IPriceConsumerV3.sol";

contract PriceConsumerV3 is IPriceConsumerV3 {
    AggregatorV2V3Interface internal ethPriceFeed;
    AggregatorV2V3Interface internal btcPriceFeed;

    /**
     * Network: Sepolia
     * Aggregators:
     * ETH/USD: 0x694AA1769357215DE4FAC081bf1f309aDC325306
     * BTC/USD: 0xA39434A63A52E749F02807ae27335515BA4b07F7
     */
    constructor() {
        ethPriceFeed = AggregatorV2V3Interface(0x694AA1769357215DE4FAC081bf1f309aDC325306);
        btcPriceFeed = AggregatorV2V3Interface(0xA39434A63A52E749F02807ae27335515BA4b07F7);
    }

    /**
     * Retorna el precio más reciente de ETH/USD
     */
    function getLatestETHPrice() public view override returns (int) {
        (
            uint80 roundID, 
            int price,
            uint startedAt,
            uint timeStamp,
            uint80 answeredInRound
        ) = ethPriceFeed.latestRoundData();
        return price;
    }

    /**
     * Retorna el precio más reciente de BTC/USD
     */
    function getLatestBTCPrice() public view override returns (int) {
        (
            uint80 roundID, 
            int price,
            uint startedAt,
            uint timeStamp,
            uint80 answeredInRound
        ) = btcPriceFeed.latestRoundData();
        return price;
    }
}

